    var point_coords = [55.711356, 37.683527];
    var map_zoom = 15;
    var point_title = 'ÐÐ½ÑÐµÑÐ½ÐµÑ-Ð¼Ð°Ð³Ð°Ð·Ð¸Ð½ ÑÐ¸ÑÑÐµÐ¼ Ð²Ð¸Ð´ÐµÐ¾Ð½Ð°Ð±Ð»ÑÐ´ÐµÐ½Ð¸Ñ';
    var image_url = 'https://texno-proekt.ru/templates/texno2015/new/img/map-pin.png';


    function contact_page_scripts() {
        if ($('.contacts-maps').length == 0) return;

        var y_map, g_map;
        var active_map = 'yandex';


        function init_yandex() {
            if (y_map == undefined) {
                ymaps.ready(function() {
                    y_map = new ymaps.Map('js-map-yandex', {
                        center: [37.683527, 55.711356],
                        zoom: map_zoom,
                    });
                    y_map.behaviors.disable('scrollZoom');

                    var placemark = new ymaps.Placemark([37.683527, 55.711356], {
                        balloonContent: point_title
                    }, {
                        iconLayout: 'default#image',
                        iconImageHref: image_url,
                        iconImageSize: [60, 70],
                        iconImageOffset: [-30, -70]
                    });
                    y_map.geoObjects.add(placemark);
                });
            }
        }



        function init_google() {
            if (g_map == undefined) {
                g_map = new google.maps.Map(document.getElementById("js-map-google"), {
                    zoom: map_zoom,
                    center: new google.maps.LatLng(point_coords[0], point_coords[1]),
                    mapTypeId: google.maps.MapTypeId.ROADMAP,
                    scrollwheel: false
                });

                var coords = new google.maps.LatLng(point_coords[0], point_coords[1]);
                new google.maps.Marker({
                    position: coords,
                    map: g_map,
                    title: point_title,
                    icon: image_url
                });
            }
        }

        function activate_map(map) {
            if (map == 'yandex') {
                $('#js-map-google').css('display', 'none');
                $('#js-map-yandex').css('display', 'block');
                $('.contacts-map-tab-yandex').addClass('active');
                $('.contacts-map-tab-google').removeClass('active');
                init_yandex();
                active_map = 'yandex';
            } else if (map == 'google') {
                $('#js-map-yandex').css('display', 'none');
                $('#js-map-google').css('display', 'block');
                $('.contacts-map-tab-google').addClass('active');
                $('.contacts-map-tab-yandex').removeClass('active');
                init_google();
                active_map = 'google';
            }
        }

        activate_map('google');

        $('.contacts-map-tab-yandex').click(function(e) {
            activate_map('yandex');
            e.preventDefault();
        });

        $('.contacts-map-tab-google').click(function(e) {
            activate_map('google');
            e.preventDefault();
        });
    }

